description:
_It is with profound regret that we are announcing the permanent closure of our Travel Agency.&nbsp;&nbsp;

Our decision to close has been driven by the current Covid 19 Pandemic and the necessary steps governments around the world and particularly in Australia to limit the movement of people in an effort to contain this deadly disease.&nbsp; Travel Agents everywhere were the first to see their businesses impacted by the pandemic and we have made the decision it is not likely that we will recover our business in the next few years.

We have also been impacted by personal tragedy with James Aitken owner of Spot On Travel being diagnosed with terminal cancer in May 2020.&nbsp; He has received world-class treatment and is heroically fighting his cancer with the support of his family and friends.

This website will be taken down shortly as will our email addresses.

We take this time to thank our clients and wish you well.

&nbsp;
